import React from 'react';
import { Service } from '../../types';
import './Services.css';

interface ServicesProps {
  services: Service[];
}

const Services: React.FC<ServicesProps> = ({ services }) => {
  return (
    <>
      <section className="section" id="service">
        <div className="container">
          <h2 className="mb-5 pb-4"><span className="text-danger">My</span> Services</h2>
          <div className="row">
            {services.map((service, index) => (
              <div key={index} className="col-md-4 col-sm-6">
                <div className="card mb-5">
                  <div className="card-header has-icon">
                    <i className={`${service.icon} text-danger`} aria-hidden="true"></i>
                  </div>
                  <div className="card-body px-4 py-3">
                    <h5 className="mb-3 card-title text-dark">{service.title}</h5>
                    <p className="subtitle">{service.description}</p>
                  </div>
                </div>
              </div>
            ))}
          </div>
        </div>
      </section>

      <section className="section bg-dark py-5">
        <div className="container text-center">
          <h2 className="text-light mb-5 font-weight-normal">I Am Available For FreeLance</h2>
          <a 
            href="https://www.fiverr.com/saqibzafar021?up_rollout=true" 
            className="btn btn-danger font-weight-bold w-lg"
            target="_blank"
            rel="noopener noreferrer"
          >
            Hire me
          </a>
        </div>
      </section>
    </>
  );
};

export default Services;
